//For pages that could not be found
import React from 'react';
const NotFound =()=>
{
    
    return (
        <div>
        <h1 className="display-form">404 Page Not Found</h1>
        <p className="lead"> Sorry, that page does not exist</p>
       
        </div>
    );

};

export default NotFound;
